import React from 'react';
import s from './Menu.module.css'

const Menu = () => {

    const links = [
        { url: '/kafedra', title: 'Кафедра' },
        { url: '/disciplina', title: 'Дисциплина' },
        { url: '/3', title: 'Направление' },
        { url: '/profil', title: 'Профиль' }
    ]

    return (
        <div className={s.mainMenu}>
            <ul class="">
                {
                    links.map((link) => (
                        <li class="mr-4 mb-4"><a href={link.url}>{link.title}</a></li>
                    ))
                }

            </ul>
        </div>
    );
}

export default Menu;
